CREATE TABLE `security_module_primary` (
  `SEQUENCE_NBR` bigint(20) NOT NULL COMMENT '物理主键',
  `PRIMARY_TYPE` varchar(16) NOT NULL COMMENT '模块主体类型（USER用户|ROLE角色）',
